import classes from './FormBtn.module.css';

const FormBtn = () => {
  return(
    <div className={classes.FormBtns}>
      <button className={classes.FormBtnLogin}>вход</button>
      <button className={classes.FormBtn}>регистрация</button>
    </div>
  )
}
export default FormBtn;
